import React from 'react';
import { Link } from 'react-router-dom';
import IntroCard from '../components/IntroCard/IntroCard';

export default function Home() {
  return (
    <div className="wrapper">
      <div className="left">
        <IntroCard />
      </div>
      <div className="right">
        <img src="/assets/homepage.png" alt="home"></img>
      </div>
    </div>
  );
}
